(1, 'Laboratory Management System (LabMS)', 'logo-lms.png', '<p style="text-align:justify">Web ini merupakan media yang digunakan oleh Laboratorium Dasar Teknik Elektro, Sekolah Teknik Elektro dan Informatikan, Institut Teknologi Bandung, untuk memberikan informasi seputar praktikum yang sedang dilaksanakan selama semester berlangsung dan.</p>\r\n\r\n<p style="text-align:justify">Semoga semua usaha yang telah dilakukan Laboratorium Dasar Teknik Elektro berkontribusi pada dihasilkannya lulusan program Teknik Elektro sebagai engineer dengan standar internasional.</p>\r\n', '<p>\r\n	This is a info of praktikum in Bandung Institut of Technology.</p>\r\n', '<p style="text-align:justify"><strong>1. Pengumpulan Laporan dan BCL</strong></p>\r\n\r\n<p style="text-align:justify">Mengirimkan file laporan melalui surat elektronik (E-mail) dalam lampiran ke : labdasar@ee.itb.ac.id dengan format sebagai berikut :</p>\r\n\r\n<p style="text-align:justify"><strong>Nama File Laporan : [modul ke] _ [NIM]</strong></p>\r\n\r\n<p style="text-align:justify"><strong>Subject : Laporan Praktikum [kode mata kuliah] _ [modul ke] _ [Nama Asisten]</strong></p>\r\n\r\n<p style="text-align:justify">Isi : Dikirimkan dalam bentuk attachment dalam bentuk .doc , .pdf atau .docx</p>\r\n\r\n<p style="text-align:justify">Waktu pengiriman paling lambat jam 12.00 wib, dua hari kerja berikutnya setelah praktikum, kecuali ada kesepakatan lain dengan dosen pengajar, pengiriman laporan yang tidak sesuai format yang telah ditentukan tidak akan diproses.</p>\r\n\r\n<p style="text-align:justify"><strong>2. Sanksi</strong></p>\r\n\r\n<p style="text-align:justify">Bagi praktikan&nbsp; yang telah melanggar ketentuan-ketentuan yang ada, akan dikenakan sanksi sesuai dengan daftar sanksi yang terdapat pada tabel sanksi praktikum laboratorium dasar teknik elektro.</p>\r\n', '<p><strong><span style="font-size:20px">LSKK Group&nbsp;</span></strong><br />\r\n<span style="font-size:16px">Institut Teknologi Bandung &nbsp; &nbsp;2nd.Floor, A. Bakrie(Labtek VIII) Bld. Jl. Ganesa 10 Bandung 40132</span></p>\r\n\r\n<p><span style="font-size:16px">Email :&nbsp;</span><span style="color:rgb(34, 34, 34); font-family:arial,sans-serif">&nbsp;</span><span style="font-size:16px"><a href="mailto:lms.stei.itb@gmail.com" style="color: rgb(17, 85, 204); font-family: arial, sans-serif; line-height: normal;" target="_blank"><span style="color:rgb(34, 34, 34)">lms</span>.stei.itb@gmail.com</a><span style="color:rgb(34, 34, 34); font-family:arial,sans-serif">&nbsp;</span></span></p>\r\n', 'Sekolah Teknik Elektro dan Informatika - ITB', 'Laboratorium Dasar Teknik Elektro');

