INSERT INTO `tb_mdl_newsfeed` (`id`, `topik`, `deskripsi`, `link`, `tanggal`) VALUES
(1, 'Tutorial Sehari Robotika', '<p style="text-align:justify">Saat ini robotika menjadi salah satu bidang ilmu pengetahuan yang sedang berkembang pesat dengan berbagai terobosan yang terus terjadi. Untuk menumbuhkan minat dan menambah pengetahuan mahasiswa akan robotika, Sekolah Teknik Elektro dan Informatika (STEI) ITB bekerjasama dengan American Embassy mengadakan tutorial dan demonstrasi robotik bertemakan &ldquo;Underwater Robotics: OpenROV&ldquo;.</p>\r\n\r\n<p style="text-align:justify">Tutorial yang dilaksanakan pada Kamis (21/08/14) bertempat di Ruang Serbaguna Perpustakaan ITB ini disampaikan langsung oleh pendiri OpenROV, Eric Stackpole, dengan dimoderatori Prof.Dr.Ir. Bambang Riyanto Tilaksono (Dosen Teknik Elektro ITB). Selain mahasiswa, dosen pun turut ikut serta mengikuti tutorial ini.</p>\r\n', 'https://stei.itb.ac.id/blog/2014/08/25/tutorial-sehari-robotika-bahas-tuntas-robot-kapal-selam-rov/', '2014-07-29 00:00:00'),
(2, 'Seminar Teknologi', 'Dalam Seminar Teknologi akan di demokan berbagai macam teknologi baru dan canggih saat ini.', 'www.itb.ac.id', '2014-07-15 00:00:00'),
(7, 'Upacara Peringatan 69 Tahun Kemerdekaan RI', '<p style="text-align: justify;">17 Agustus selalu menjadi momen spesial bagi warga negara Indonesia. Di hari ini bangsa Indonesia memperingati hari kemerdekaan Republik Indonesia. Terhitung 17 Agustus 2014, Indonesia telah menjadi Negara Kesatuan selama 69 tahun.</p>\r\n\r\n<p style="text-align: justify;">Untuk itu, Institut Teknologi Bandung mengadakan upacara peringatan kemerdekaan Negara Kesatuan Republik Indonesia di lapangan Sasana Olahraga Ganesha (Saraga) pada Minggu (17/08/14) pagi. Upacara ini dihadiri oleh segenap civitas academica ITB, baik itu jajaran rektor, dosen, maupun perwakilah dari KM-ITB. Seperti tahun-tahun sebelumnya, seluruh mahasiswa baru pun diwajibkan menghadiri upacara bendera kali itu.</p>\r\n', 'https://stei.itb.ac.id/blog/2014/08/18/itb-selenggarakan-upacara-peringatan-69-tahun-kemerdekaan-negara-kesatuan-republik-indonesia/', '2014-07-15 14:20:19'),
(8, 'Tim Robotika ITB Juara III pada International Micro Robot Maze Contest 2014', '<p style="text-align: justify;">International Micro Robot Maze Contest adalah kompetisi robot mikro tahunan yang diselenggarakan oleh Nagoya University, Nagoya, Jepang. Kompetisi ini diselenggarakan sejak tahun 1991, dan pada tahun 2014 merupakan penyelenggaraan yang ke 23, yaitu pada tanggal 9 November 2014.</p>\r\n\r\n<p style="text-align: justify;">Pada International Micro Robot Maze Contest ini dipertandingkan 5 kategori yaitu: Micro Robot Racer berukuran 1 cm kubik, Teleoperated Micro Robot Maze berukuran 1 cm kubik, Autonomous Micro Robot berukuran 1 cm kubik, Legged Micro Robot dan Free Performance Micro Robot. Peserta kompetisi berasal dari berbagai negara, seperti Jepang, Amerika Serikat, Thailand, Korea Selatan, Taiwan dan Indonesia.</p>\r\n\r\n<p style="text-align: justify;">Tim Micro Maze Robot ITB 2014 yang beranggotakan 5 orang mahasiswa mengikutsertakan 5 buah robot mikro. Pada kompetisi tersebut tim dapat memperoleh Juara Ketiga untuk kategori 3B, yaitu Multiple Legged Micro Robot.</p>\r\n\r\n<p style="text-align: justify;">Anggota tim: Fariz Maulana (Teknik Elektro 2011), Evan Prianto (Teknik Elektro 2012), Ali Akbar (Fisika 2012), Mochammad Yusuf (Teknik Mesin 2012), Nurul Fajar (Teknik Mesin 2012)</p>\r\n\r\n<p style="text-align: justify;">Sumber:&nbsp;<strong style="color:rgb(76, 142, 185); margin:0px; padding:0px; text-decoration:none"><a href="https://www.stei.itb.ac.id/file/stei-script/soni.html" style="margin: 0px; padding: 0px; text-decoration: none; color: rgb(76, 142, 185);">Dr. Kusprasapta Mutijarsa, ST. MT</a></strong></p>\r\n', 'https://stei.itb.ac.id/blog/2014/11/11/tim-robotika-itb-juara-iii-pada-international-micro-robot-maze-contest-2014/', '2014-11-14 02:32:52');

